import react from "react";
import {Link} from "react-router-dom"

const Navbar = () => {
    return (
        <div className="navbar nav1 bg-dark">
            <Link to="/" ><h1 className="navbar-brand nav">homepage</h1></Link>
        </div>
    )
}

export default Navbar;
